// index.js
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Importa el enrutador y las rutas
import Main from './Main';

ReactDOM.render(
  <Router>
    <Routes>
      <Route path="/" element={<Main />} /> {/* Utiliza el componente Main como elemento principal */}
    </Routes>
  </Router>,
  document.getElementById('root')
);
